import React, { useState } from 'react';
import logo from '../Components/logo.png'; // Make sure the path to your logo is correct

function LoginPage() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();
    // Here, you can integrate your authentication logic or API call for login
    console.log('Login Details:', { email, password });
  };

  return (
    <div style={{ textAlign: 'center', padding: 20 }}>
      <img src={logo} alt="logo" style={{ maxWidth: '150px' }} />
      <h3><b>Login</b></h3>
      <p>All of you welcome</p>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor='email'>Email</label>
          <input
            type='email'
            id='email'
            placeholder='Enter your Email'
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor='password'>Password</label>
          <input
            type='password'
            id='password'
            placeholder='Enter your Password'
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
        </div>
        <div>
          <a href='/forgot-password'>Forgot password?</a>
        </div>
        <button
          className="btn btn-outline-light btn-lg px-5"
          id='login-btn'
          type="submit"
          style={{ backgroundColor: '#110942', color: '#FFF' }}
        >
          Login
        </button>
      </form>
    </div>
  );
}

export default LoginPage;
